import React, {useState} from 'react'
import Sidebar from './SidebarStudent/Sidebar';

function Submit1() {
    const[link1, setLink1] = useState("");

    const handleSubmitLink1 = (event) => {
        event.preventDefault();
        alert('You have submited the project for the first deadline')
    }
    
    return (
        <div>
            <Sidebar/>
             <div className="ddl1">
                Submit the link for the first deadline
                    <form onSubmit={handleSubmitLink1}>
                        <label>Deadline 1
                            <input type="text"
                            value={link1}
                            onChange={(e)=> setLink1(e.target.value)}/>
                        </label>
                        <br/>
                        <button type="submit">Submit</button>
                    </form>
            </div>
        </div>
    )
}

export default Submit1
